  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.css']
})
export class HomeComponent {

}
<p>home works!</p>
<div>
    <button routerLink="signup">Sign up</button>
    <button routerLink="signin">Sign in</button>
</div>
